using namespace std;

 int jump(vector<int>& nums) {
        int n=nums.size();
        if(n==1) return 0;
        vector<int> a(n,0);
        for(int i=n-2;i>=0;i--){
         if(nums[i]==0) a[i]=INT_MAX;
         else if(i+nums[i]>=n-1) a[i]=1;
         else {
             int min=INT_MAX;
             for(int j=i+1;j<=i+nums[i];j++) if(min>a[j]) min=a[j];
             a[i]=min+1;}}
             return a[0];
    }

